import React, { useState } from "react";

const Formulario = () => {
    const [formData, setFormData] = useState({
        nombres: "",
        apellidos: "",
        pais: "",
        ciudad: "",
        sexo: "",
        edad: "",
        tipoEmprendimiento: "",
        subcategoriaPrincipal: "",
        subcategoriaSecundaria: "",
    });

    const [ciudadesDisponibles, setCiudadesDisponibles] = useState([]);
    const [subcategoriasPrincipales, setSubcategoriasPrincipales] = useState([]);
    const [subcategoriasSecundarias, setSubcategoriasSecundarias] = useState([]);
    const [errorEdad, setErrorEdad] = useState("");

    // Lista de ciudades por país
    const ciudadesPorPais = {
        COLOMBIA: ["Arauca", "Armenia", "Barranquilla", "Bogotá D.C.", "Bucaramanga", "Cali", "Cartagena", "Cúcuta", "Florencia", "Ibagué", "Inírida", "Leticia", "Manizales", "Medellín", "Mitú", "Mocoa", "Montería", "Neiva", "Pasto", "Pereira", "Popayán", "Puerto Carreño", "Quibdó", "Riohacha", "San Andrés", "San José del Guaviare", "Santa Marta", "Sincelejo", "Tunja", "Valledupar", "Villavicencio", "Yopal"],
        ARGENTINA: ["Buenos Aires", "Córdoba", "Corrientes", "Formosa", "La Rioja", "Mendoza", "Neuquén", "Paraná", "Posadas", "Rawson", "Resistencia", "Río Gallegos", "Salta", "San Fernando del Valle de Catamarca", "San Juan", "San Luis", "San Miguel de Tucumán", "San Salvador de Jujuy", "Santa Fe", "Santa Rosa", "Santiago del Estero", "Ushuaia", "Viedma"],
        BRASIL: ["Aracaju", "Belém", "Belo Horizonte", "Boa Vista", "Brasília", "Campo Grande", "Cuiabá", "Curitiba", "Florianópolis", "Fortaleza", "Goiânia", "João Pessoa", "Macapá", "Maceió", "Manaus", "Natal", "Palmas", "Porto Alegre", "Porto Velho", "Recife", "Rio Branco", "Rio de Janeiro", "Salvador", "São Luís", "São Paulo", "Teresina", "Vitória"],
        MÉXICO: ["Aguascalientes", "Campeche", "Chihuahua", "Ciudad de México", "Culiacán", "Durango", "Guadalajara", "Hermosillo", "La Paz", "León", "Mérida", "Mexicali", "Monterrey", "Morelia", "Oaxaca", "Puebla", "Querétaro", "Saltillo", "San Luis Potosí", "Tepic", "Tlaxcala", "Toluca", "Tuxtla Gutiérrez", "Veracruz", "Villahermosa", "Zacatecas"],
        CHILE: ["Antofagasta", "Arica", "Castro", "Copiapó", "Concepción", "Iquique", "La Serena", "Puerto Montt", "Punta Arenas", "Rancagua", "Santiago", "Talca", "Valdivia", "Valparaíso"],
        PERÚ: ["Arequipa", "Ayacucho", "Bagua", "Callao", "Cusco", "Huancayo", "Huaraz", "Ica", "Iquitos", "Juliaca", "Lima", "Moyobamba", "Pucallpa", "Piura", "Puno", "Trujillo", "Tumbes", "Tarapoto", "Tacna", "Chimbote"],
        PANAMÁ: ["Bocas del Toro", "Chiriquí", "Coclé", "Colón", "Darién", "Herrera", "Los Santos", "Panamá", "Veraguas"]
    };

    // Subcategorías principales y secundarias
    const subcategoriasPorTipo = {
        PRODUCTOS: ["ALIMENTOS Y BEBIDAS", "MODA Y ACCESORIOS", "HOGAR Y JARDÍN", "TECNOLOGÍA Y ELECTRÓNICA", "DEPORTES Y AIRE LIBRE", "AUTOMOTRIZ Y TRANSPORTE", "INDUSTRIA Y CONSTRUCCIÓN", "SALUD Y BELLEZA", "INFANTIL", "MASCOTAS", "OFICINA", "ARTE", "SEGURIDAD", "EVENTOS Y CELEBRACIONES", "PRODUCTOS ESPECIALIZADOS", "OTROS ARTÍCULOS"],
        SERVICIOS: ["Consultoría", "Asesoramiento técnico", "Gestión de eventos", "Reparaciones a domicilio", "Servicios tecnológicos", "Educación y capacitación", "Servicios médicos y estéticos", "Transporte y logística", "Servicios de limpieza", "Marketing y publicidad", "Otros servicios"]
    };

    const subcategoriasProductosEspecificas = {
        "ALIMENTOS Y BEBIDAS": ["Aceites, vinagres y condimentos", "Alimentos deshidratados y enlatados", "Alimentos frescos (frutas/verduras)", "Alimentos vegetarianos, veganos, gourmet y orgánicos", "Bebidas alcohólicas", "Restaurante (cualquier tipo)"],
        "MODA Y ACCESORIOS": ["Accesorios para cabello", "Bisutería", "Calzado", "Moda masculina", "Moda femenina"],
        "OTROS ARTÍCULOS": ["Otros artículos"]
    };
    const handleChange = (e) => {
        const { name, value } = e.target;

        if (name === "pais") {
            setCiudadesDisponibles(ciudadesPorPais[value] || []);
            setFormData({ ...formData, [name]: value, ciudad: "" });
        } else if (name === "tipoEmprendimiento") {
            setSubcategoriasPrincipales(subcategoriasPorTipo[value] || []);
            setFormData({ ...formData, [name]: value, subcategoriaPrincipal: "", subcategoriaSecundaria: "" });
        } else if (name === "subcategoriaPrincipal") {
            setSubcategoriasSecundarias(subcategoriasProductosEspecificas[value] || []);
            setFormData({ ...formData, [name]: value, subcategoriaSecundaria: "" });
        } else if (name === "edad") {
            const nuevoValor = value.replace(/\D/g, "");
            setFormData({ ...formData, [name]: nuevoValor });

            if (nuevoValor && parseInt(nuevoValor, 10) < 18) {
                setErrorEdad("Debes ser mayor de edad, si eres menor no puedes inscribirte.");
            } else {
                setErrorEdad("");
            }
        } else {
            const nuevoValor = (name === "nombres" || name === "apellidos") ? value.toUpperCase() : value;
            setFormData({ ...formData, [name]: nuevoValor });
        }
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (parseInt(formData.edad, 10) < 18) {
            alert("Debes ser mayor de edad, si eres menor no puedes inscribirte.");
            return;
        }
        console.log("Datos del formulario:", formData);
    };

    return (
        <form onSubmit={handleSubmit}>
            <label htmlFor="pais">País:</label>
            <select id="pais" name="pais" value={formData.pais} onChange={handleChange} required>
                <option value="">Selecciona un país</option>
                {Object.keys(ciudadesPorPais).map((pais) => (
                    <option key={pais} value={pais}>{pais}</option>
                ))}
            </select>

            <label htmlFor="ciudad">Ciudad:</label>
            <select id="ciudad" name="ciudad" value={formData.ciudad} onChange={handleChange} required>
                <option value="">Selecciona una ciudad</option>
                {ciudadesDisponibles.length > 0 ? (
                    ciudadesDisponibles.map((ciudad, index) => (
                        <option key={index} value={ciudad}>{ciudad}</option>
                    ))
                ) : (
                    <option value="" disabled>Primero selecciona un país</option>
                )}
            </select>

            <label htmlFor="nombres">Nombres:</label>
            <input type="text" id="nombres" name="nombres" value={formData.nombres} onChange={handleChange} required />

            <label htmlFor="apellidos">Apellidos:</label>
            <input type="text" id="apellidos" name="apellidos" value={formData.apellidos} onChange={handleChange} required />

            <label htmlFor="sexo">Sexo con el que te identificas:</label>
            <select id="sexo" name="sexo" value={formData.sexo} onChange={handleChange} required>
                <option value="">Selecciona una opción</option>
                <option value="FEMENINO">FEMENINO</option>
                <option value="MASCULINO">MASCULINO</option>
                <option value="OTRO">OTRO</option>
            </select>

            <label htmlFor="edad">Edad:</label>
            <input type="text" id="edad" name="edad" value={formData.edad} onChange={handleChange} required />
            {errorEdad && <p style={{ color: "red" }}>{errorEdad}</p>}

            <label htmlFor="tipoEmprendimiento">Mi emprendimiento se centra en:</label>
            <select id="tipoEmprendimiento" name="tipoEmprendimiento" value={formData.tipoEmprendimiento} onChange={handleChange} required>
                <option value="">Selecciona una opción</option>
                <option value="PRODUCTOS">PRODUCTOS</option>
                <option value="SERVICIOS">SERVICIOS</option>
            </select>

            <label htmlFor="subcategoriaPrincipal">Categoría de productos o servicios:</label>
            <select id="subcategoriaPrincipal" name="subcategoriaPrincipal" value={formData.subcategoriaPrincipal} onChange={handleChange} required>
                <option value="">Selecciona una categoría</option>
                {subcategoriasPrincipales.map((subcategoria, index) => (
                    <option key={index} value={subcategoria}>{subcategoria}</option>
                ))}
            </select>

            <label htmlFor="subcategoriaSecundaria">Subcategoría específica:</label>
            <select id="subcategoriaSecundaria" name="subcategoriaSecundaria" value={formData.subcategoriaSecundaria} onChange={handleChange} required>
                <option value="">Selecciona una subcategoría</option>
                {subcategoriasSecundarias.map((subcategoria, index) => (
                    <option key={index} value={subcategoria}>{subcategoria}</option>
                ))}
            </select>

            <button type="submit">Enviar</button>
        </form>
    );
};

export default Formulario;
